import React, { Component } from 'react'
import axios from 'axios';
const URL_PATH = 'http://localhost:8081/power-plants';

export default class PowerPlantList extends Component {
    constructor(props){
        super(props)

        this.state = {
          data: [],
          filter:"",
          totalPages: '',
          nextPage: ''
        }
        this._loadData = this._loadData.bind(this);

      }

      componentWillMount(){
        this._loadData(); 

     }
     _loadData() {
        const {   data } = this.state;


        axios.get(URL_PATH).then(response => {
         console.log(response); 
          this.setState({
            data: response.data,

          });

        });
      }

    render() {
        const getData = this.state.data;
        return (

          <div className="container"> 
            <h3>Power Plants</h3>
            <div className="row">
                  <div className="col m4 s4 center-align">
                      <label>Sort By</label>
                      <select onChange={this.filterChamp.bind(this)} value={this.state.filterChamp} className="browser-default">
                          <option value="">Select</option>
                          <option value="desc">Rating Descending</option>
                          <option value="asc">Rating Ascending</option>
                      </select>
                  </div>
              </div> 
            <table>
        <thead>
          <tr>
              <th>Bundesnetza gentur Number</th>
              <th>Company</th>
              <th>Type</th>
              <th>State</th>
              <th>Production Value (kW)</th>
              <th>Agg.Production (kW)</th>
          </tr>
        </thead>

        <tbody>
        {getData.map((row, i)=>(
          <tr key={i}> 
            <td>{row.bundesnetzagentur_number}</td>
            <td>{row.comapny_name}</td>
            <td>{row.type}</td>
            <td>{row.state}</td>
            <td>{row.production_value_kw}</td>
            <td>{row.aggregated_production_kw}</td>
          </tr>
          ))} 

        </tbody>
      </table>   

            </div>
        )
    }
}
